import React, { useState } from 'react';
import Button from '@material-ui/core/Button';
import AddIcon from '@material-ui/icons/Add';

const Todo = () => {
  
    const [itemsEvent, setitemsEvent] = useState('');
  
    const Ieve = (event) => {
        setitemsEvent(event.target.value);
    }
  
  
  
    return(
        <>
        <div>
            <div>
                <br/>
                <h1> TODO List</h1>
                <br/>
                <input type="text" placeholder="add items" onChange={Ieve}/>
                <Button><AddIcon/></Button>

                <ol>
                    <li> {itemsEvent} </li>
                </ol>
            </div>
        </div>
        </>
    );
};

export default Todo
